(3, 105, 'mission', 'meet-the-team-2', '<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">{KomentoDisable}Hello\" is a song recorded by <a title=\"England\" href=\"https://en.wikipedia.org/wiki/England\">English</a> singer-songwriter <a title=\"Adele\" href=\"https://en.wikipedia.org/wiki/Adele\">Adele</a>, released on 23 October 2015 by <a title=\"XL Recordings\" href=\"https://en.wikipedia.org/wiki/XL_Recordings\">XL Recordings</a> as the <a title=\"Lead single\" href=\"https://en.wikipedia.org/wiki/Lead_single\">lead single</a> from her third studio album, <em><a title=\"25 (Adele album)\" href=\"https://en.wikipedia.org/wiki/25_(Adele_album)\">25</a></em> (2015). Written by Adele and the album\'s producer, <a title=\"Greg Kurstin\" href=\"https://en.wikipedia.org/wiki/Greg_Kurstin\">Greg Kurstin</a>, \"Hello\" is a <a class=\"mw-redirect\" title=\"Piano ballade\" href=\"https://en.wikipedia.org/wiki/Piano_ballade\">piano ballad</a> with <a title=\"Soul music\" href=\"https://en.wikipedia.org/wiki/Soul_music\">soul</a> influences (including guitar and drums), and lyrics that discuss themes of nostalgia and regret. Upon release, the song garnered critical acclaim, with reviewers comparing it favourably to fbrth6jk8uk87kk87k87ki9l968l9l9l8l Adele\'s previous works and praised its lyrics, production and Adele\'s vocal performance. It was recorded in <a title=\"Metropolis Group\" href=\"https://en.wikipedia.org/wiki/Metropolis_Group\">Metropolis Studios</a>, London.</span></p>\r\n<h4><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Our vision</strong></span></h4>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Equitable socio-economic development coutrywide.</span></p>\r\n<h4><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Mission</strong></span></h4>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">To Provide Leadership and Policy direction for effective and efficient management of the Fund.</span></p>\r\n<h4><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Core Values</strong></span></h4>\r\n<ol>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Transparency and Accountability</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Professionalism and Integrity</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Commitment and Teamwork</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Neutrality and Objectivity</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Timeliness and Excellence Advocacy For Citizen Participation</span></li>\r\n</ol>', '', 1, 8, '2024-02-22 10:28:13', 785, '', '2024-02-27 09:06:49', 785, NULL, NULL, '2024-02-22 10:28:13', NULL, '{\"image_intro\":\"\",\"image_intro_alt\":\"\",\"float_intro\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"float_fulltext\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":\"\",\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":\"\",\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":\"\",\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\