(242, 0, 'j51_jasmine', 'template', 'j51_jasmine', '', '', 0, 1, 1, 0, 0, '{\"name\":\"j51_jasmine\",\"type\":\"template\",\"creationDate\":\"February 2022\",\"author\":\"Joomla51\",\"copyright\":\"Joomla51\",\"authorEmail\":\"info@joomla51.com\",\"authorUrl\":\"http:\\/\\/www.joomla51.com\",\"version\":\"1.1.6\",\"description\":\"<link href=\\\"..\\/templates\\/j51_jasmine\\/css\\/admin.css\\\" rel=\\\"stylesheet\\\" media=\\\"all\\\" \\/>\\n\\n    <div class=\\\"extension-info\\\">\\n    \\t<div class=\\\"extension-info__image\\\">\\n\\t\\t\\t<img src=\\\"..\\/templates\\/j51_jasmine\\/template_thumbnail.png\\\" border=\\\"0\\\" class=\\\"extension-info__image\\\"\\/>\\n    \\t<\\/div>\\n\\t\\t<div class=\\\"extension-info__details\\\">\\n\\n\\t\\t\\t<p>\\n\\t\\t\\t\\tToday we are happy to introduce Jasmine, our new addition to the Joomla51 template collection. The light and stylish layout combined with carefully crafted typography gives Jasmine a bright and fresh design. A fully stacked feature set allows you easy control of layout and coloring via an easy to use template settings panel. Create a host of beautiful website elements quickly and easily with a collection of bundled module extensions including slideshows, galleries and rotating testimonials. Get started today with the Jasmine Joomla template and enjoy seamlessly crafting beautifully designed, fully responsive websites. \\n\\t\\t\\t<\\/p>\\n\\n\\t\\t\\t<p>\\n      <a class=\\\"btn btn-primary\\\" style=\\\"margin-right:10px;\\\" target=\\\"_blank\\\" href=\\\"http:\\/\\/www.joomla51.com\\/\\\">Joomla51<\\/a>\\n      <a class=\\\"btn btn-primary\\\" target=\\\"_blank\\\" href=\\\"http:\\/\\/www.joomla51.com\\/tutorials\\\">Template Tutorials<\\/a>\\n    <\\/p>\\n\\t\\t<\\/div>\\n\\t<\\/div>\\n\\t<div class=\\\"preset\\\">\\n\\t\\t<div class=\\\"preset__load\\\">\\n\\t\\t\\t<h6>Load Preset<\\/h6>\\n\\t\\t\\t<select name=\\\"preset\\\" class=\\\"form-control\\\">\\n\\t\\t\\t\\t<option value=\\\"Example_St