(4, 'index.php?option=com_content&view=article&id=1', 'index.php?option=com_content&view=article&id=1:wamba-cdf&catid=8', 'WAMBA CDF ', ' {KomentoDisable} wamba cdf Hello\" is a song recorded by English singer-songwriter Adele, released on 23 October 2015 by XL Recordings as the lead single from her third studio album, 25 (2015). Written by Adele and the album\'s producer, Greg Kurstin, \"Hello\" is a piano ballad with soul influences (including guitar and drums), and lyrics that discuss themes of nostalgia and regret. Upon release, the song garnered critical acclaim, with reviewers comparing it favourably to fbrth6jk8uk87kk87k87ki9l968l9l9l8l Adele\'s previous works and praised its lyrics, production and Adele\'s vocal performance. It was recorded in Metropolis Studios, London. ', '2024-02-26 15:58:34', '62bb54a60ae3cd14ddbf5fe7f7454b81', 1, 1, 1, '*', '2024-02-22 10:16:11', NULL, '2024-02-22 10:16:11', NULL, 0, 0, 3, ),
