(6, 'index.php?option=com_content&view=article&id=3', 'index.php?option=com_content&view=article&id=3:meet-the-team-2&catid=8', 'mission', ' {KomentoDisable}Hello\" is a song recorded by English singer-songwriter Adele, released on 23 October 2015 by XL Recordings as the lead single from her third studio album, 25 (2015). Written by Adele and the album\'s producer, Greg Kurstin, \"Hello\" is a piano ballad with soul influences (including guitar and drums), and lyrics that discuss themes of nostalgia and regret. Upon release, the song garnered critical acclaim, with reviewers comparing it favourably to fbrth6jk8uk87kk87k87ki9l968l9l9l8l Adele\'s previous works and praised its lyrics, production and Adele\'s vocal performance. It was recorded in Metropolis Studios, London. Our vision Equitable socio-economic development coutrywide. Mission To Provide Leadership and Policy direction for effective and efficient management of the Fund. Core Values Transparency and Accountability Professionalism and Integrity Commitment and Teamwork Neutrality and Objectivity Timeliness and Excellence Advocacy For Citizen Participation ', '2024-02-27 09:06:49', '01a23526be308fb0159d2d51ef88fae6', 1, 1, 1, '*', '2024-02-22 10:28:13', NULL, '2024-02-22 10:28:13', NULL, 0, 0, 3, ),
