(55, 'com_content.article.1', '', '2024-02-26 15:53:34', 785, 3326, '4da054dab31fd76c452d19065eff50b8f63b6632', '{\"id\":\"1\",\"asset_id\":103,\"title\":\"WAMBA CDF \",\"alias\":\"wamba-cdf\",\"introtext\":\"<h1 style=\\\"text-align: center;\\\"><span style=\\\"font-family: \'book antiqua\', palatino, serif;\\\">{KomentoDisable} wamba cdf<\\/span><\\/h1>\\r\\n<p><span style=\\\"font-family: \'book antiqua\', palatino, serif;\\\">Hello\\\" is a song recorded by <a title=\\\"England\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/England\\\">English<\\/a>\\u00a0singer-songwriter\\u00a0<a title=\\\"Adele\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Adele\\\">Adele<\\/a>, released on 23 October 2015 by\\u00a0<a title=\\\"XL Recordings\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/XL_Recordings\\\">XL Recordings<\\/a>\\u00a0as the\\u00a0<a title=\\\"Lead single\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Lead_single\\\">lead single<\\/a>\\u00a0from her third studio album,\\u00a0<em><a title=\\\"25 (Adele album)\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/25_(Adele_album)\\\">25<\\/a><\\/em>\\u00a0(2015). Written by Adele and the album\'s producer,\\u00a0<a title=\\\"Greg Kurstin\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Greg_Kurstin\\\">Greg Kurstin<\\/a>, \\\"Hello\\\" is a\\u00a0<a class=\\\"mw-redirect\\\" title=\\\"Piano ballade\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Piano_ballade\\\">piano ballad<\\/a>\\u00a0with\\u00a0<a title=\\\"Soul music\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Soul_music\\\">soul<\\/a>\\u00a0influences (including guitar and drums), and lyrics that discuss themes of nostalgia and regret. Upon release, the song garnered critical acclaim, with reviewers comparing it favourably to fbrth6jk8uk87kk87k87ki9l968l9l9l8l Adele\'s previous works and praised its lyrics, production and Adele\'s vocal performance. It was recorded in\\u00a0<a title=\\\"Metropolis Group\\\" href=\\\"https:\\/\\/en.wi