(64, 'com_content.article.2', '', '2024-02-26 16:02:29', 785, 3215, '9e2a8d15a8d6dd5be3ce1c462f58e3d3a0c1f6ad', '{\"id\":\"2\",\"asset_id\":104,\"title\":\"meet the team\",\"alias\":\"meet-the-team\",\"introtext\":\"<p><span style=\\\"font-family: \'book antiqua\', palatino, serif;\\\">{KomentoDisable}Hello\\\" is a song recorded by\\u00a0<a title=\\\"England\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/England\\\">English<\\/a>\\u00a0singer-songwriter\\u00a0<a title=\\\"Adele\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Adele\\\">Adele<\\/a>, released on 23 October 2015 by\\u00a0<a title=\\\"XL Recordings\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/XL_Recordings\\\">XL Recordings<\\/a>\\u00a0as the\\u00a0<a title=\\\"Lead single\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Lead_single\\\">lead single<\\/a>\\u00a0from her third studio album,\\u00a0<em><a title=\\\"25 (Adele album)\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/25_(Adele_album)\\\">25<\\/a><\\/em>\\u00a0(2015). Written by Adele and the album\'s producer,\\u00a0<a title=\\\"Greg Kurstin\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Greg_Kurstin\\\">Greg Kurstin<\\/a>, \\\"Hello\\\" is a\\u00a0<a class=\\\"mw-redirect\\\" title=\\\"Piano ballade\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Piano_ballade\\\">piano ballad<\\/a>\\u00a0with\\u00a0<a title=\\\"Soul music\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Soul_music\\\">soul<\\/a>\\u00a0influences (including guitar and drums), and lyrics that discuss themes of nostalgia and regret. Upon release, the song garnered critical acclaim, with reviewers comparing it favourably to fbrth6jk8uk87kk87k87ki9l968l9l9l8l Adele\'s previous works and praised its lyrics, production and Adele\'s vocal performance. It was recorded in\\u00a0<a title=\\\"Metropolis Group\\\" href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Metropolis_Group\\\">Metropolis Studios<\\/a>, London.<\\/span><\\/p>\",\"fulltext\":\"\",\"state\":\"1\